import React from "react";

function ItemListContainer() {
    return (
      <>
        <p 
        style={{
          color: 'black',
          fontSize: '50px',
          textAlign: 'center',
          fontWeight : '20px',
          fontFamily : 'Arial black'
          }}>
          Bienvenido a 
          <span
          style={{
            color: 'orange',
            fontWeight : 'bold'
          }}
          > STADIUM
          </span>
          </p>
      </>
    );
  }
  
  export default ItemListContainer;
